import{a as n,r,o as e,d as t,u as i}from"./index.1205de85.js";const o={name:"home"},s=Object.assign(o,{setup:o=>(n(),(n,o)=>{const s=r("v-md-preview");return e(),t(s,{text:i("> YUI-admin 是一个管理端模板解决方案，它是基于 vue3 和 element-plus，项目都是以 composition api 风格编写。\r\n\r\n## 简介\r\n\r\n项目使用 vue3 + pinia + vue-router@4.x + mock + sass + elementPlus 开发，基于 eslint + prettier 代码格式化风格的管理系统模板\r\n项目目的：主要是提供大部分通用模板及公共方法等常用组件及效果的分享，尽量在项目使用时可以快速查到\r\n\r\n在线 demo 演示地址：[https://zhouxunweijie.github.io/YUI-admin.github.io](https://zhouxunweijie.github.io/YUI-admin.github.io)\r\n\r\n### 功能\r\n\r\n```text\r\n- 用户管理\r\n\t- 登录\r\n\t- 注销\r\n\r\n- 权限验证\r\n  - 动态路由\r\n\r\n- 多环境发布 (对应serve,build)\r\n  - dev\r\n  - test\r\n  - prod\r\n\r\n- 全局功能\r\n  - iconfont\r\n  - 路由分享\r\n  - 全局主题颜色更改\r\n  - 动态侧边栏（支持多级路由嵌套）\r\n  - 快捷导航(标签页)\r\n  - 本地/后端 mock 数据\r\n  - Screenfull全屏\r\n  - 自适应收缩侧边栏\r\n  - 动态主题切换\r\n  - 可设置水印、tagview、logo、菜单栏搜索框隐藏显示\r\n\r\n```\r\n\r\n### 目录结构\r\n\r\n```\r\nadmin-tmpl\r\n├─ .eslintrc.js       # eslint\r\n├─ .prettierrc.json       # prettier\r\n├─ .prettierignore       # prettier忽略文件\r\n├─ README.md\r\n├─ dist               # 打包dist\r\n├─ public             # 静态资源\r\n├─ src                # 源码\r\n│  ├─ api             # 接口请求\r\n│  ├─ assets          # webpack打包的资源\r\n|  ├─ mock            # mock服务\r\n│  ├─ components      # 公共组件\r\n│  ├─ config          # 全部配置\r\n│  ├─ hooks           # 组件内常用方法\r\n│  ├─ layout          # 全局Layout\r\n│  ├─ login           # 登录页面\r\n│  ├─ router          # 路由\r\n│  ├─ store           # 全局store管理\r\n│  ├─ style           # 全局样式\r\n│  ├─ utils           # 全局公共方法\r\n│  └─ views           # 所有业务页面\r\n└─ vue.config.js      # vue-cli 配置\r\n\r\n```\r\n\r\n### 前端启动\r\n\r\n```\r\n  npm run dev\r\n```\r\n")},null,8,["text"])})});export{s as default};
